    def noo(self):
        while True:
            sleep(0.5)
            logs = requests.get('http://localhost:5250/logs').json()["logs"]
            print(logs)
            for linha in logs:
                lista2.append(linha.replace('\n', ''))
                self.listViewAba1.setModel(
                    QtCore.QStringListModel(lista2))
                self.listViewAba1.setStyleSheet(
                    "QListView::item {"
                    "  margin-top: 2px;"
                    "  margin-bottom: 2px;"
                    "  margin-left: 10px;"
                    "  margin-right: 10px;"
                    "  border-width: 1px;"
                    "  border-color: #999;"
                    "  border-radius: 9px;"
                    "  background: #FFFF64;"
                    "  padding: 10px;"
                    "}"
                )
                Ui_MainWindow.remover_linha(linha)
                self.listViewAba1.scrollToBottom()
                app.processEvents()

    def remover_linha(linha):
        with open("config.txt", 'r') as f:
            lines = f.readlines()
        with open("config.txt", 'w') as f:
            for l in lines:
                if l != linha:
                    f.write(l)


